window.fbAsyncInit=function(){FB.init({appId:ced_sociallogin.appid,xfbml:true,version:'v2.1'});};function ced_sociallogin_signin_callback(response){if(response.authResponse){jQuery.ajax({type:'POST',url:ced_sociallogin.ajaxurl,data:{state:ced_sociallogin.state,access_token:response.authResponse.accessToken,expires_in:response.authResponse.expiresIn},dataType:'json',success:function(data){window.location.replace(data.redirect);}});}else{console.log('User cancelled login or did not fully authorize.');}}